import React from 'react'
import { Button } from '@material-ui/core'
const Index = (props) => {
    return <Button onClick={props.onClick} disabled={props.disabled ? "disabled" : ""} className={props.className + " btn btn-light"} aria-label={props.icon}>{props.text}</Button>
}

export default Index;
